import React, {useEffect} from 'react'
import './HighEnds.css'

const HighEnds = () => {
  useEffect(() => {
    const background = document.getElementById('first-section');

    background.scrollIntoView({
      behavior:"smooth",
      block:"start",
      inline:"nearest"
    })

    if (background) {
      background.style.opacity = '.55';
    }
  }, []);

  return <div id="highend-container" >
      <div id="first-section-background" class="background">
        <div id="first-section"></div>
        <div id="types">
            <span><img src="" value="1"/>Sub Zero</span>
            <span><img src="" value="2"/>Viking</span>
            <span><img src="" value="3"/>Monogram</span>
            <span><img src="" value="4"/>Bertazzoni</span>
        </div>
      </div>
    </div>
};

export default HighEnds;
